import '../styles/adminNavbar.css'

const AdminNavbar = () => {
    return ( 
        <div className="adminNavbar">
            <div className="navbar01">
                <div>
                    <h1>AdminPortal</h1>
                </div>
                <div className='Nav_links'>
                    
                        <Link>Add Books</Link>
                        <Link>Add Users</Link>
                        <Link>BookL</Link>
                        <Link>UserL</Link>
                        <Link>LogOut</Link>
    
                </div>
            </div>
        </div>
     );
}
 
export default AdminNavbar;
